INSERT INTO `content` VALUES (106,'nl','<div class=\"gebouw\"><img title=\"Praktijk\" src=\"../data/images/34.jpg\" alt=\"De Praktijk\" width=\"556\" height=\"286\" /></div>\n<p>Het secretariaat is bereikbaar<br /> van <strong>maandag - vrijdag</strong><br /> van <strong>8:00 - 12:00</strong> en van <strong>16:00 - 19:00</strong></p>\n<div class=\"persoon\"><img title=\"Sabine\" src=\"../data/images/27.png\" alt=\"Sabine\" width=\"180\" height=\"238\" /><br />\n<p>Sabine</p>\n</div>\n<div class=\"persoon\"><img title=\"Nele\" src=\"../data/images/28.jpg\" alt=\"Nele\" width=\"176\" height=\"238\" /><br />\n<p>Nele</p>\n</div>\n<p>Gelieve zoveel mogelijk te bellen tijdens de aanwezigheid van onze secretaresse. Zij beantwoordt onze telefoon tijdens de raadplegingen en de huisbezoeken. Zij tracht u zo goed mogelijk van dienst te zijn. Indien ons advies nodig is, wordt u doorgeschakeld.</p>\n<div class=\"gebouw\"><img title=\"Kaartje\" src=\"../data/images/35.JPG\" alt=\"\" width=\"556\" /></div>\n<p><a href=\"privacy\">Privacy verklaring</a> - <a href=\"disclaimer\">Disclaimer</a></p>'),(120,'nl','<h1>Nieuwe<br />collega-arts<br />vanaf 01/09/2012</h1>\n<p>Dr. Lies Delameillieure is afgestudeerd als basisarts en vervolledigt haar opleiding tot huisarts bij ons.&nbsp;Wij zijn ervan overtuigd dat zij een meerwaarde betekent zowel op medisch als organisatorisch vlak en hopen daarom ook te kunnen rekenen op uw enthousiasme.</p>'),(118,'nl','<h1>Dokter<br />Hilde Tack</h1>\n<p class=\"aanwezig\">is aanwezig</p>\n<p><strong>ochtend</strong> (08:30 - 12:00)<br /> maandag, vrijdag</p>\n<p><strong>middag</strong> (14:00 - 16:00)<br />maandag, vrijdag</p>\n<p><strong>avond</strong> (17:00 - 19:00)<br />dinsdag, donderdag</p>'),(119,'nl','<h1>Dokter<br />Lies Gheyle</h1>\n<p class=\"aanwezig\">is aanwezig</p>\n<p><strong>ochtend</strong> (08:30 - 12:00)<br /> maandag, dinsdag, donderdag</p>\n<p><strong>middag</strong> (14:00 - 16:00)<br /> dinsdag</p>\n<p><strong>avond</strong> (17:00 - 19:00)<br /> maandag, woensdag, vrijdag</p>'),(117,'nl','<h1>Dokter<br />Sabine Fevery</h1>\n<p class=\"aanwezig\">is aanwezig</p>\n<p><strong>ochtend</strong> (08:30 - 12:00)<br />dinsdag, woensdag, vrijdag</p>\n<p><strong>middag</strong> (14:00 - 16:00)<br /><br /></p>\n<p><strong>avond</strong> (17:00 - 19:00)<br /> maandag, donderdag<img title=\"- nog maar eentje\" src=\"../data/images/48.png\" alt=\"- nog maar eentje\" width=\"24\" height=\"23\" /></p>'),(121,'nl','<h1>Dokter<br />Lies Delameillieure</h1>\n<p class=\"aanwezig\">is aanwezig</p>\n<p><strong>ochtend</strong> (08:30 - 12:00)<br />woensdag, donderdag</p>\n<p><strong>middag</strong> (14:00 - 16:00)<br />maandag, woensdag, donderdag</p>\n<p><strong>avond</strong> (17:00 - 19:00)<br />dinsdag, vrijdag</p>'),(103,'nl','<p>U kan elke werkdag &eacute;&eacute;n van de artsen bereiken van 08:00 tot 21:00 (vrijdagavond tot 19:00).<br /> Voor dringende zaken na 21u raden wij u aan de wachtdienst te contacteren.</p>\n<p><a class=\"maakAfspraak button icons\" href=\"afspraak\">Kilk hier voor een afspraak</a></p>\n<p>Het secretariaat is bereikbaar van <strong>maandag - vrijdag</strong> van <strong>08:00 - 12:00</strong> en van <strong>16:00 - 19:00</strong></p>\n<table class=\"bezoekmoment\">\n<tbody>\n<tr><th>&nbsp;</th><th>Ochtend<br /><span>08:00 - 12:00</span></th><th>Middag<br /><span>14:00 - 16:00</span></th><th>Avond<br /><span>16:00 - 18:00</span></th></tr>\n<tr class=\"even\">\n<td class=\"day\">Maandag</td>\n<td><span class=\"dr\">dr. Lies Gheyle</span><span class=\"dr\">dr. Hilde Tack</span></td>\n<td><span class=\"dr\">dr. Lies Delameillieure</span><span class=\"dr\">dr. Hilde Tack</span></td>\n<td><span class=\"dr\">dr. Sabine Fevery</span><span class=\"dr\">dr. Lies Gheyle</span></td>\n</tr>\n<tr>\n<td class=\"day\">Dinsdag</td>\n<td><span class=\"dr\">dr. Lies Gheyle</span><span class=\"dr\">dr. Sabine Fevery</span></td>\n<td><span class=\"dr\">dr. Lies Gheyle</span></td>\n<td><span class=\"dr\">dr. Lies Delameillieure</span><span class=\"dr\">dr. Hilde Tack</span></td>\n</tr>\n<tr class=\"even\">\n<td class=\"day\">Woensdag</td>\n<td><span class=\"dr\">dr. Sabine Fevery</span><span class=\"dr\">dr. Lies Delameillieure</span></td>\n<td><span class=\"dr\">dr. Lies Delameillieure</span></td>\n<td><span class=\"dr\">dr. Lies Gheyle</span></td>\n</tr>\n<tr>\n<td class=\"day\">Donderdag</td>\n<td><span class=\"dr\">dr. Lies Gheyle</span><span class=\"dr\">dr. Lies Delameillieure</span></td>\n<td><span class=\"dr\">dr. Lies Delameillieure</span></td>\n<td><span class=\"dr\">dr. Sabine Fevery</span><span class=\"dr\">dr. Hilde Tack</span></td>\n</tr>\n<tr class=\"even\">\n<td class=\"day\">Vrijdag</td>\n<td><span class=\"dr\">dr. Sabine Fevery</span><span class=\"dr\">dr. Hilde Tack</span></td>\n<td><span class=\"dr\">dr. Hilde Tack</span></td>\n<td><span class=\"dr\">dr. Lies Gheyle</span><span class=\"dr\">dr. Lies Delameillieure</span></td>\n</tr>\n</tbody>\n</table>'),(111,'nl','<p>Indien u wegens een (on)voorziene omstandigheid toch niet kan verschijnen op uw afspraak, appreci&euml;ren wij het ten zeerste dit tijdig te annuleren.</p>\n<p>Afspraken die niet tijdig geannuleerd worden zonder een aanvaardbare reden worden vanaf 01/04/2011 aangerekend zonder tussenkomst van de mutualiteiten.</p>'),(112,'nl','<p><img style=\"float: right; margin: 5px;\" title=\"Attest\" src=\"../data/images/30.jpg\" alt=\"Attest\" width=\"154\" height=\"215\" />Voor al uw attesten en formulieren vragen wij om langs te komen op consultatie. Wij kunnen enkel bepaalde zaken attesteren na u gezien te hebben.</p>\n<p>Als arts mogen wij enkel attesten schrijven die stroken met de waarheid. Valse attesten zullen u steeds geweigerd worden.</p>\n<p>Gelieve uw medicatievoorschriften zoveel mogelijk tijdens de consultatie te vragen. Uw chronische medicatie kan verlengd worden voor&nbsp;een periode van&nbsp;3 maand.&nbsp;Uitzonderingen hierop zijn: de anticonceptiepil (12 maand) en schildkliermedicatie (6 maand).&nbsp;</p>'),(113,'nl','<p>In uw globaal medisch dossier houden wij al uw medische gegevens bij die van belang zijn voor uw gezondheid. Dit is&nbsp;belangrijk om u de meest optimale zorg aan te bieden.&nbsp;</p>\n<p>Als u een globaal medisch dossier afsluit bij uw huisartsenpraktijk, krijgt u 30% meer terugbetaald van het ziekenfonds voor consultaties bij uw huisarts.</p>\n<p>Het globaal medisch dossier kan aangevraagd worden aan ons secretariaat. Het enige wat hiervoor nodig is, is een kleefbriefje van uw ziekenfonds.</p>\n<p>Het globaal medisch dossier wordt jaarlijks vernieuwd.</p>'),(114,'nl','<p><img style=\"float: right; margin: 5px;\" title=\"Een es\" src=\"../data/images/31.jpg\" alt=\"Een es\" width=\"132\" height=\"180\" />Wij zijn 4 huisartsen die intensief samenwerken in &eacute;&eacute;n huisartsenpraktijk. Door een goed dossiersysteem en onze wekelijkse overlegmomenten, zorgen wij ervoor dat u bij alle 4 de artsen even goed terecht kan. Het blijft uiteraard uw keuze bij welke arts(en)&nbsp;u consulteert.</p>\n<p>Het is onze overtuiging dat samenwerken nuttig is. Hierdoor kunnen wij u een goede beschikbaarheid bieden, kunnen wij overleggen en vaak deelnemen aan bijscholingen. Dit zorgt ervoor dat we u de meest optimale zorg kunnen aanbieden.</p>\n<p>Door samen te werken in &eacute;&eacute;n praktijk, krijgen wij als arts tevens de mogelijkheid om tijd vrij te maken voor een eigen sociaal en familiaal leven.</p>'),(115,'nl','<p>De huisartsenpraktijk \'De Essen\' is een jonge en dynamische groepspraktijk waar de zorg voor onze pati&euml;nten centraal staat.&nbsp;Wij&nbsp;willen&nbsp;deze zorg bieden,&nbsp;als team, zoveel&nbsp;als mogelijk wetenschappelijk onderbouwd,&nbsp;met respect&nbsp;voor&nbsp;uw en onze visie.&nbsp;<br />&nbsp;</p>\n<p>Om deze zorg mogelijk te maken,&nbsp;wensen wij een paar afspraken met u te maken. Deze zijn te vinden op onze website.&nbsp;<br />&nbsp;</p>\n<p>Wij hopen zo op een fijne samenwerking en bedanken u voor het vertrouwen dat u stelt in onze praktijk.</p>'),(116,'nl','<ul class=\"simple\">\n<li>diagnose en behandeling van uw klachten</li>\n<li>bloedafname</li>\n<li>medicatievoorschriften</li>\n<li>afname van EKG (hartonderzoek)</li>\n<li>preoperatief onderzoek</li>\n<li>algemeen onderzoek aangevraagd door uw verzekeringsmakelaar</li>\n<li>gynaecologisch onderzoek&nbsp;(uitstrijkje)&nbsp;en borstonderzoek</li>\n<li>pilvoorschrift</li>\n<li>zwangerschapsdiagnose en opvolging, in samenwerking met uw gynaecoloog</li>\n<li>vaccinatie (ook van baby\'s en kinderen)</li>\n<li>gipsen van breuken</li>\n<li>hechten van een snijwonde</li>\n<li>bevriezen (cryotherapie) van verschillende huidletsels waaronder wratten</li>\n<li>een ondersteunend gesprek</li>\n<li>psychologische begeleiding</li>\n<li>medische en mentale begeleiding tijdens het levenseinde, in samenwerking met palliatief netwerk</li>\n<li>reisadvies</li>\n<li>advies i.v.m. allerlei gezondheidsproblemen</li>\n<li>bijhouden van je medisch dossier</li>\n<li>samenwerking met andere hulpverleners: kinesist, osteopaat, verpleegkundige, psycholoog,...</li>\n<li>eventuele verwijzing naar een specialist</li>\n</ul>'),(122,'nl','<p>Vanaf 01/04/2011 kan u bij uw huisarts terecht voor een gratis preventief onderzoek, het GMD plus. Dit geldt voor alle personen tussen de 45 en 75 jaar die een GMD afgesloten hebben bij de huisarts.</p>\n<p>Deze consultatie wordt enkel in de voormiddag of namiddag aangeboden. Voor de consultatie wordt gevraagd aan de pati&euml;nt een vragenlijst in te vullen en die ingevuld mee te nemen op de dag van consultatie.</p>\n<p>Tijdens het gratis preventieve consult worden geen andere zaken besproken of medicatie voorgeschreven.</p>'),(123,'nl','<p><img style=\"float: right; margin: 5px;\" title=\"Essenblad\" src=\"../data/images/33.jpg\" alt=\"\" width=\"299\" height=\"200\" /><strong>Karakter</strong></p>\n<p>De es heeft een bijzonder bekoorlijk karakter en is daardoor zeer geliefd. Fair Play staat hoog in zijn vaandel. De es bezit veel zelfdiscipline en is erg ambitieus. Kleurloze meelopers zijn onder essen niet te vinden en zij tarten het lot graag. Hij wil graag goed overkomen en etaleren dat hij veel kennis heeft van alles wat het leven te bieden heeft. Of dat nu wel of niet het geval is, de es weet altijd de schijn op te houden. <br /> Op grond van zijn levendige karakter, optimisme en verlangen doet hij steeds wat hij voor juist houdt en van kritiek trekt hij zich niets aan. Als de es een doel heeft, stopt hij niet voordat dit is bereikt. Hij kan rustig op bepaalde kansen wachten en wanneer een kans zich voordoet, grijpt hij die met beide handen aan en weet hij zijn mogelijkheden optimaal te benutten. Het lijkt wel of de es zelfs de moeilijkste doelen spelenderwijs bereikt. <br /> Door drukte in zijn omgeving kan hij af en toe een beetje in de war zijn, waardoor hij soms zeer ego&iuml;stisch is en zich kan opdringen aan de omgeving. Zelfzuchtig is hij echter niet, want hij is ook bereid anderen te helpen. Bovendien is hij behalve een wijze en intelligente boom, ook best een lieve en goedige boom.</p>\n<p>In de liefde is de es trouw en voorzichtig, vaak wint het verstand het van zijn gevoel. Een es hecht veel waarde aan vertrouwen, vrienden kunnen dan ook op hem bouwen. Bevriend raken met de es is echter niet zo gemakkelijk. Hij zal niet direct laten merken dat hij je heeft opgemerkt, laat staan dat je gemakkelijk contact met hem kunt krijgen. Je moet er wel wat voor doen. Ten eerste moet je laten merken dat je respect hebt voor zijn veelheid aan ervaringen, voor zijn levenswijsheid en dat je zijn goede raad hoog acht. Je moet begrip tonen voor het feit dat hij zo groot is, dat is hij namelijk niet zonder reden: op die manier ziet en hoort hij zoveel, dat hij altijd op de hoogte is van de laatste nieuwtjes. Daardoor is hij ondanks zijn ogenschijnlijke ongenaakbaarheid geliefd bij iedereen die op de hoogte wil blijven van de actuele zaken. <br /> Je moet zijn raad echter wel met een korreltje zout nemen, want hij heeft de neiging de zaken enigszins te verdraaien naar zijn eigen inzicht, zodat de waarheid wel eens in het gedrang kan komen. Ten tweede moet je er rekening mee houden dat als hij eenmaal zijn aandacht op je heeft gevestigd er een communicatie tot stand is gekomen, dat deze dan ook onvoorwaardelijk is. Er is op dat moment geen ruimte voor de mening of invloed van derden. Hij is er dan alleen maar voor jou en jij moet je dan ook volledig op hem richten.</p>\n<p>&nbsp;</p>\n<p><strong>Eigenschappen <br /></strong> Ambitieus, intelligent, wijs, stralend, hulpvaardig, traditioneel, melancholisch, controlerend, zoekend naar het ongewone, ego&iuml;stisch, trouw, trots, optimistisch en voorzichtig in de liefde</p>\n<p>&nbsp;</p>\n<p><strong>Mythes <br /></strong> Fraxinus betekent speer of lans, exelcior betekent zoveel als &lsquo;boven de anderen uit stekend&rsquo;. <br /> De es was lang geleden voor de bewoners van Noord-Europa de belangrijkste boom. Ze zagen in hem de drager van de wereld. De wereld-es had zijn wortels in de onderwereld, zijn stam in de mensenwereld en zijn kroon in de hemel waar de goden woonden. Het was een symbool voor onsterfelijkheid en levenskracht. In allerlei legenden en godsdiensten wordt de es ge&euml;erd als heilige boom, beschermer des goden en als beschermheilige van de oogst en omdat essenhout zo flexibel en Voor de Germanen was de es de boom van het leven, de wereld van de es verdorde nooit. De goden bezochten de nornen, drie Germaanse schikgodinnen die het lot bepaalden, onder de wereld-es, als zij iets wilden weten over de toekomst. Veel van onze voorouders stonden te luisteren naar het geritsel van de bladeren van deze boom in de hoop zo iets van hun toekomst op te vangen.</p>\n<p>Volgens de Noorse, Germaanse en Griekse mythologie is de man uit een es ontstaan. Stoere Vikingen werden ook wel Esmensen genoemd en de Germaanse oppergod Wodan (ook wel Odin of Ygg genaamd) sneed een speer uit deze boom. Nemesis, de Griekse godin der wake, droeg een staf van essenhout en de lansen van Griekse helden uit de Illias en de Odyssee waren eveneens van essenhout. Achilles doodde Hetor tijdens het gevecht om Troje met een speer van dit hout. <br /> Gebruik <br /> De Vikingen geloofden in de toverkracht van de es en zij maakten speerschachten, mesheften en boten van essenhout, omdat het hen bijzondere macht zou verlenen en tegen het kwaad zou beschermen. Het zaad van de es zou bovendien bij mannen lustopwekkend werken. Kelten dronken en aten het liefst uit een essenhouten beker en schaal. Dit gaf kracht en genas. Heksen gebruikten essenhout om hun bezemsteel van te maken. <br /> De Romein Plinius schrijft dat de es slangen afschrikt. Als je een slang laat kiezen door essenhout te schuiven of door vuur, zal ze eerder door het vuur kruipen dan in essenloof. Daarom hingen bezorgde moeders hun baby&rsquo;s in hangmatjes tussen essen, zo durfde geen enkel gevaarlijk dier zich te tonen.</p>\n<p>De es is een grote en sterke boom waarvan het hout zo vreselijk hard en tegelijkertijd toch buigzaam is. Essenhout werd behalve voor het maken van allerlei technische voorwerpen, zoals disselbomen, wielen en scheepsmasten, ook gebruikt voor wapens als speren en pijlen. In de oudheid werd het hout in woningen gebruikt. Tegenwoordig wordt essenhout vooral gebruikt voor het maken van meubels, gymnastiek- en sportwerktuigen (ski&rsquo;s) en koetswerk.</p>\n<p>&nbsp;</p>\n<p><strong>Genezing</strong> <br /> De dru&iuml;den sneden toverstafjes, zogenaamde runren, uit de es. <br /> Een amulet van essenhout bezat een bijzondere beschermende werking tegen vervloekingen en kwade bedoelingen van heksen. <br /> De Kelten geloofden dat de es verbitterde en ontgoochelde mensen uit de kring van doemdenken kon verlossen. Elke dag een wandeling naar de es, er even tegenaan leunen terwijl je je kommer en kwel vertelde, gaf je energie en levenskracht. <br /> Hippocrates raadde essenbladerenthee aan tegen reuma, jicht en koorts</p>\n<p>&nbsp;</p>\n<p><em>Bron: Mari&euml;lle Lapidaire; boomkompas.blogspot.com</em></p>'),(108,'nl','<p>U kan elke werkdag &eacute;&eacute;n van de artsen bereiken van 8u tot 21u (de vrijdagavond tot 19u). Voor dringende zaken na 21u raden wij u aan de wachtdienst te contacteren.</p>\n<p>Tijdens het weekend en op feestdagen kan u terecht bij de wachtdienst:</p>\n<p>- Regio Groot Brugge:&nbsp;<strong>078/15.15.90</strong></p>\n<p><strong>-</strong>&nbsp;Regio Varsenare, Jabbeke, Snellegem, Stalhille en Zerkegem:&nbsp;<strong>050/39.72.62</strong></p>'),(104,'nl','<p>Wij hebben als huisarts ook nood aan vakantie en vrije tijd. Daarnaast kunnen wij ook afwezig zijn voor het volgen van bepaalde opleidingen.</p>\n<p>De&nbsp;afwezigheid van een&nbsp;arts&nbsp;wordt een tijd op voorhand aangekondigd op deze website en in de wachtzaal. De consultaties worden dan overgenomen door de overblijvende artsen.<strong><br /></strong></p>\n<p><strong>Dr. Tack zal afwezig zijn op:</strong><br />- 01/10/12 t/m 15/10/12</p>\n<p><strong>Dr. Gheyle zal afwezig zijn op:</strong><br />- 29/10/12 t/m 19/11/12</p>\n<p><strong>Dr. Fevery zal afwezig zijn op:</strong><br />- 07/09/12 t/m 23/09/12</p>'),(0,'nl',NULL),(107,'nl','<p>In onze praktijk&nbsp;beschikken&nbsp;wij over de ideale omstandigheden om u te onderzoeken en te behandelen (aanwezigheid van medische materiaal en volledige dossiergegevens).</p>\n<p>Daarom vragen wij om zoveel&nbsp;als mogelijk&nbsp;bij ons op consultatie te komen.</p>\n<p>Indien dit wegens omstandigheden niet mogelijk is, kan u steeds een huisbezoek aanvragen.&nbsp;Gelieve dit bij voorkeur te doen tussen 08u00 en 10u30.</p>\n<p>Voor de huisbezoeken hebben wij een beurtrolsysteem. Wij kunnen u niet steeds garanderen dat uw huisarts naar keuze kan langskomen voor huisbezoeken die op de dag zelf worden aangevraagd. Dit kan enkel gegarandeerd worden voor huisbezoeken die op voorhand gepland worden.</p>\n<hr />\n<p>Voor nieuwe pati&euml;nten (aansluiting in praktijk na 1 januari 2009) kunnen wij enkel nog huisbezoeken doen in de regio\'s St-Andries, St-Michiels en Varsenare.</p>'),(97,'nl','<p><span>Huisartsenpraktijk De Essen draagt zorg voor uw privacy. Lees deze Privacyverklaring om meer te weten te komen over de manier waarop persoonsgegevens worden ingezameld en verwerkt op deze website. In dit geval handelt Huisartsenpraktijk De Essen daarbij steeds in overeenstemming met de bepalingen van de Belgische privacywet (Wet van 8 december 1992 tot bescherming van de persoonlijke levenssfeer ten opzichte van de verwerking van persoonsgegevens). De persoonlijke gegevens beperken zich enkel tot uw e-mailadres.</span></p>\n<p><span><strong>Verantwoordelijke</strong></span></p>\n<p><span>De verantwoordelijke voor de verwerking is Huisartsenpraktijk De Essen; Lage Bekeweg 1, 8200 Brugge - St. Andries.</span></p>\n<p><span><strong>Kennisname</strong></span></p>\n<p><span>U kan van deze persoonsgegevens kennis nemen door een aanvraag te richten aan Huisartsenpraktijk De Essen</span><span>(brief, fax of e-mail) en ze, indien nodig, doen verbeteren of verwijderen. Indien u niet gecontacteerd wenst te worden in het kader van email marketing, zullen uw gegevens op uw verzoek kosteloos uit de betrokken lijsten worden</span></p>\n<p><span><strong>Cookies</strong></span></p>\n<p><span>Wij gebruiken cookies om uw toekomstig bezoek aan onze site vlotter te laten verlopen. Een cookie is een klein stukje tekst dat op uw harde schijf wordt geplaatst. Cookies worden veel gebruikt om een hoger functionaliteit, en dus betere dienst, aan de bezoekers te kunnen aanbieden. [U kan het gebruik van cookies uitschakelen, al leidt dit er wel toe dat effecten opsommen die ten gevolge van het uitschakelen van cookies worden veroorzaakt.]</span></p>\n<p><span><strong>Veiligheid</strong></span></p>\n<p><span>Huisartsenpraktijk De Essen verbindt zich ertoe om al de gepaste technische en organisatorische maatregelen te treffen om uw persoonsgegevens te beschermen tegen vernietiging, verlies, onbedoelde wijziging, beschadiging of openbaarmaking.</span></p>\n<p><span><strong>Toestemming</strong></span></p>\n<p><span>Door u akkoord te verklaren met deze voorwaarden en condities geeft u ook uw toestemming voor de verwerking van uw persoonsgegevens voor de doeleinden zoals hierboven beschreven.</span></p>'),(98,'nl','<p><span>Door gebruik te maken van deze website verklaart u zich akkoord met onderstaande voorwaarden en condities.</span></p>\n<p><span><strong>1. Website</strong></span></p>\n<p>De eigenaar van deze website is&nbsp;<br /> Huisartsenpraktijk De Essen,<br /> Lagebekeweg 1<br /> 8200, Brugge,&nbsp;<br /> Belgi&euml;<br /> Tel: 32(0)50 395066,&nbsp;<br /> E-mail: secretariaat@de-essen.be&nbsp;<br />ON: 0811.314.136</p>\n<p><span>Als u niet akkoord gaat met onderstaande voorwaarden wordt u verzocht de website te verlaten. Huisartsenpraktijk De Essen behoudt zich het recht voor deze voorwaarden periodisch aan te passen waarna de leden op de hoogte zullen worden gebracht van deze wijzigingen. Wanneer u na deze kennisgeving de website blijft gebruiken verklaart u zich akkoord met de doorgevoerde wijzigingen. Huisartsenpraktijk De Essen&nbsp; kan eventueel andere diensten aanbieden aan de gebruikers van deze site. In dat geval zullen de geldende voorwaarden apart worden medegedeeld.</span></p>\n<p><span><strong>2. Toegankelijkheid</strong></span></p>\n<p><span>Huisartsenpraktijk De Essen&nbsp; probeert zo goed als mogelijk de website 24 uur per dag toegankelijk te houden, nochtans kan het gebeuren dat de website ontoegankelijk is voor een korte periode omwille van onderhoudswerken, aanpassingen of technische redenen.</span></p>\n<p><span><strong>3. Verantwoordelijkheid</strong></span></p>\n<p><span>Huisartsenpraktijk De Essen weerlegt elke verantwoordelijkheid met betrekking tot deze website en de aangeboden informatie. Huisartsenpraktijk De Essen&nbsp; verzekert niet dat de informatie op deze website correct, compleet of actueel is. Alle informatie, producten en diensten op deze website kunnen fouten bevatten. De gebruiker wordt verzocht hiermee rekening te houden.</span></p>\n<div><span><br /></span></div>');
